createApp({data(){return{currentUserName:"",users:[],isLoading:!0,selectedUser:new UserModel}},methods:{async disableUser(){alert("Sorry, this functionality is still missing #sadface")},loadUsers(){var n=this;this.isLoading=!0;axios.get("/api/users").then(function(t){n.users=t.data;n.isLoading=!1}).catch(t=>{UiHelpers.showErrorToast("Error","",t.message),n.isLoading=!1})},showDisableDialog(n){if(n.userName==this.currentUserName){alert("You cannot disable the current user");return}this.selectedUser=n;$("#modal-disable-user").modal()}},mounted:function(){this.isLoading=!1;this.currentUserName=this.$el.parentElement.getAttribute("data-current-user-name");UiHelpers.setPageHeader("Users");this.loadUsers()}}).mount("#app-user");